description:
This IP Changer is a tool to change the IP, which your Tibia Client should connect to. It will also work for all versions from Tibia 7.1 to Tibia 9.81
This IP-changer also has support for MC, and the otserv:// protocol.


Visit  &lt;a href=&quot;
http://www.otservlist.org/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.otservlist.org/&lt;/a&gt;
or  &lt;a href=&quot;
http://www.tibialist.com/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.tibialist.com/&lt;/a&gt;
to find your favourite Open Tibia Server.
